import React from 'react';
import NavBar from '../components/navbar.js';
import './home.css'

function Home() {
    return (
        <div>
            <NavBar />
            <section className="home_sect1">
                <div className="container-fluid">
                    <div className="row">
                        <div className="md-6">
                            <div className="sect1">

                            </div>
                        </div>
                        <div className="md-6">
                            <img src="translanova\src\images\home_sect1_img.jpg" ></img>
                        </div>
                    </div>
                </div>
            </section>

        </div>
    );
}

export default Home;
